class Solution {
    vector<int> ht;
    vector<int> wt;
    int n;
    vector<int> d;
    vector<vector<int>> matrix;
public:
    int bestSeqAtIndex(vector<int>& height, vector<int>& weight) {
        ht = height;
        wt = weight;
        n = height.size();
        if (n <= 1)
        {
            return n;
        }
        d = vector<int>(n, -1);

        matrix = vector<vector<int>>(n, vector<int>());
        for (int i = 0; i < n; i++)
        {
            for (int j = i+1; j < n; j++)
            {
                if (ht[i] > ht[j] && wt[i] > wt[j])
                {
                    matrix[i].push_back(j);
                }
                else if (ht[j] > ht[i] && wt[j] > wt[i])
                {
                    matrix[j].push_back(i);
                }
            }
        }


        int best = 0;
        for (int i = 0; i < n; i++)
        {
            best = max(best, dp(i));
        }
        return best;
    }

    int dp(int i)
    {
        if (d[i] != -1)
            return d[i];
        int& ans = d[i];
        ans = 1;
        for (int j : matrix[i])
        {
            ans = max(ans, 1 + dp(j));
        }

        return ans;
    }
};

